        "status": "publish",
        "catalog_visibility": "visible",
        "description": "<p>Get whiter teeth in 1 week* with Colgate Optic White ® Sparkling White™ Whitening Toothpaste. The smart foam system gently whitens while thoroughly cleans your teeth. Now with whitening accelerators**, stains can be safely exfoliated from teeth surface for a long lasting white radiant smile*. It is also an anticavity fluoride toothpaste which is enamel safe. When used regularly, Colgate Optic White Toothpaste can also help: - Fights cavities - Protect enamel - Remove plaque*** - Freshen breath *When used as directed, for extrinsic stains only, vs non-whitening toothpaste. With continuous use. Results may vary. ** with high cleaning silica and core-shell silica<a href=\"https://www.google.com\"> ***when brushing Shelf life: 3 years from manufacturing date Brushing Tips: Brush thoroughly. Do not swallow. Spit out and rinse after use. Children below 6 years old: Use a pea-sized amount under supervised brushing to m</a>inimize swallowing. Brush at least twice a day or as directed by a dentist or doctor. Control sugar intake. Get a dental check-up at least once a year. Colgate - More than 200 years of expertise For over 200 years, Colgate has worked to make the world a better place by introducing products that help people lead healthier, happier lives. Colgate builds upon a rich heritage of innovation to develop products such the first oral rinse to prevent tartar buildup, to improving the effectiveness of whitening toothpaste with its Optic White brand, for hundreds of million of people around the globe.\"</p>\n",
